import React from 'react';
import {GridList,GridListTile,ListSubheader,GridListTileBar} from '@material-ui/core'

function Body(props) {
  return (
      <div >
      <GridList cellHeight={250} cols={4} spacing={8}>
        {props.data.map(val => (
          <GridListTile key={val.id}>
            <img src={`https://farm${val.farm}.staticflickr.com/${val.server}/${val.id}_${val.secret}.jpg`} />
          </GridListTile>
        ))}
      </GridList>
  </div>
  );
}

export default Body;
